import { GET_ALL_PRODUCT } from '../actions/types';

const initialState = {
    all_product:[]
};

export default function(state = initialState, action ) {
    switch(action.type) {
        case GET_ALL_PRODUCT:
            return {
                ...state,
                all_product:action.payload
            };
        default: 
            return state;
    }
}
